  [],\n\t\"revision_timestamp\": \"2016-07-27T22:56:05.381460\",\n\t\"name\": \"prairie-remnants-survey-of-the-blackwater-rna-ridgefield-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"An inventory and monitoring project of
  grass bald (prairie remnant) habitats on the Carty Unit of the Ridgefield National
  Wildlife Refuge (Refuge), including the Blackwater Island Research Natural Area
  (RNA), was conducted from August, 2011 through September, 2012. Bald habitats were
  inventoried and delineated; plant species, plant communities and potential plant
  associations were described; key native and non-native invasive plant species were
  documented and mapped; and searches were conducted for historic vegetation sample
  transects.  Re-sampling was conducted in the vicinity of two historic transects.
  Two new vegetation monitoring sample areas were laid out, and one was sampled for
  point line intercept cover and nested frequency.  Thirteen photomonitoring points
  were established to monitor long-term change.\",\n\t\"license_title\": \"License
